import "./App.css";
import { Route, Routes } from "react-router-dom";
import Container from "./components/Container/Container";
import Menu from "./components/Menu/Menu";
import QuestionList from "./components/QuestionList/QuestionType";

function App() {
  return (
    <Container>
      <Routes>
        <Route path="/" element={<Menu />} />
        <Route path="/:year" element={<QuestionList />} />
      </Routes>
    </Container>
  );
}

export default App;
